import React from "react";
import './style.css';
import lisa from "./lisa.jpg";
import angry from "./angry.jpg";
import nutri from "./nutri.png";
import uniqlo from "./uniqlo.png";
import UniqloPage from "./UniqloPage";
import {
  HashRouter as Router,
  Switch,
  Route,
  Link,
  useParams,
  useRouteMatch
} from "react-router-dom";
import Home from "./Home";

function Grid() {
  return (
    <Router basename={process.env.PUBLIC_URL}>
      <div>
        <Link to={`${url}/uniqlo`}>
          Uniqlo
        </Link>

        <hr />
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>
          <Route path="/uniqlo">
            <UniqloPage />
          </Route>
        </Switch>
      </div>
    </Router>
  )
}

export default Grid;
